import React from 'react';
import gt from '../../pictures/GeorgiaTech.png';
import "../../styles/Education.css";

function Education() {
    return (
        <div>
            <img src={gt} alt="GT" />
            <div class="block">
                <h1>Georgia Tech</h1>
                <h3>Master's of Science in Computer Science</h3>
            </div>
        </div>
    );
}

export default Education;
